    function setEvvmID(uint256 newEvvmID) external;
    function setPointStaker(address user, bytes1 answer) external;
    function validateAndConsumeNonce(
        address user,
        bytes32 hashPayload,
        address originExecutor,
        uint256 nonce,
        bool isAsyncExec,
        bytes memory signature
    ) external;
